import React, { Component } from "react";

class Detail extends Component{
    componentDidMount(){
        const {location,history} = this.props;
        if (location.state === undefined){
            history.push("/");
        }
    }
    render(){
        const {state} = this.props.location;
        if (state){
            return (
                <div>
                    {state.summary}
                    <span>{state.title}</span>
                </div>
            )
        }else{
            return null;
        }
    }
}

export default Detail;
